const { sampleRate, currentTime, parameters, outputs } = ProcessSandbox;

const perItem = 1 / sampleRate;

this.isTriggered = this.isTriggered ?? false;
this.startedAt = this.startedAt ?? null;
this.prevTime = this.prevTime ?? null;

const trigger = parameters.A;
const offset = parameters.B;
const output = outputs[0];

if(trigger[0] >= 0.5 && !this.isTriggered){
    this.isTriggered = true;
    this.startedAt = currentTime;
} 

if(trigger[0] < 0.5 && this.isTriggered){
    this.isTriggered = false;
}


const frameTime = (currentTime - this.startedAt + (offset[0] || 0))

output.forEach(channel => {
    channel.forEach((item, index) => {
        if(this.isTriggered){
            channel[index] = frameTime + (perItem * index);
        } else {
            channel[index] = 0
        }
    });
})

this.prevTime = currentTime;
